INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (164,'008','봄토끼가 동쪽으로 오르니 맑은 빛을 맑이함과 같습니다. 서쪽에 길함이 있어 반드시 좋은 소식있겠습니다. 올해의 운은 귀인이 나를 도움으로 많은 일을 순조롭게 이루겠습니다. 필시 기쁜 일이 있을 텐데 이는 신이 나를 보호하는 까닭이겠습니다. 또한 모든 일이 내 마음같이 이루어지니 갈수록 복이 많아지겠습니다. 금년은 남쪽과 북쪽에 복이 좋은 일이 있어 그곳으로 가게될 운입니다. 그러나 좋은 일에 마가 닿는 이치처럼 얻는 것도 많고 앗는 것도 많겠습니다. 사월에 남풍에 보리가 누렇빛을 뿌는 것처럼 의험과 흉을 이갈음 후에 복덕이 충만한 낙락을 보내게됩니다. 매사가 나의 뜻대로 이루어지므로 생각과 행동이 같고 복덕 또한 풍성하므로 마치 보배로운 자로 하늘을 보는것과 같습니다.','달 밝은 동창에 매화를 힘록함과 같겠습니다. 재운이 몸을 따르니 낙락이 운이 좋아지고 천금의 재물로 가산이 넓넓해지겠습니다. 이 달이 산처럼 높게 재물을 모으게되므로 의기양양해지겠습니다.','달 밝은 높은 누각에 풍류 소리가 높겠습니다. 복덕이 풍만한 가운데 화색이 만연하니 부유함을 그리겠습니다. 좋은 일이 생겨 재산을 모우게 되고 밖으로 나가면 더 큰 이익을 얻게 될 것입니다. 이달지 않으면 자손에게 경사가 있으니 이례자례 좋은 여세입니다.','먼길을 가지 마십시오. 집에 있는 것이 길하고 떠나는 것은 흉하겠습니다. 더 큰 복덕을 바라고 이동하느니 집안에서 조용히 내일을 몽둘하는 것이 좋겠습니다. 남쪽으로 가지 마십시오. 흉한 흉이 도사리고 있습니다.','버들가지 위에 꽃봉오리가 앉았으니 얼마나 아름다운 장경입니까? 하는 일마다 황금을 얻게되니 세상사가 좋게만 보이겠습니다. 꽃이 떨어지고 열매를 얻게되니 재물이 풍성하고 당연히 생활은 태평해지겠습니다. 먼데 친척도 가까이 대하십시오.','풍진같은 복을 모아서 산같이 대길함을 얻게되니 좋은 일만 생기겠습니다. 그러나 이 달에는 관재수가 있으니 조심해야겠습니다. 이렇지 않으면 구설이 따르겠습니다. 가까운 사람에게서 해를 입을 수니 너무 믿어버리지 뭇지 않겠습니다.','별로 이익이 없겠습니다. 친한 사람이 남보다 못하니 나에게 해를 입힐 수 있습니다. 물에 가까이 가지 마십시오 아는 사람이 내게 해를 낳치겠습니다. 만일 남과 다툰지 않으면 반드시 성사가 있겠습니다. 출행을 삼가고 자신을 지키십시오.','재운이 따르겠습니다. 이익이 사방에 있으므로 가는 곳마다 좋은 일 생기겠습니다. 단비같은 복덕이 내리므로 재물이 풍년처럼 이루어지겠습니다. 그러나 재물을 구한다 하여도 잠병이 있을까 두렵습니다. 과욕이 나를 막치니 매사를 신중히 하십시오','쉬지 않고 부지런히 일하면 하늘도 감동하여 나에게 이익을 내리겠습니다. 동쪽과 서쪽으로 가면 길하겠습니다. 만일 탐욕스러움으로 분수 밖의 것을 탐하게되면 재앙이 닥치니 흉험을 부리지 말고 인간된 도리를 지키는게 좋겠습니다.','길가에 나가면 손재가 있으니 올데없는 일로 나다니 것은 좋지 않겠습니다. 높은 산에 백합이 있는 것도 반드시 주인이 있는 법입니다. 어려운 일을 성취하는 주안공이 되어야 하겠습니다.','무슨 일을 행하든 타인에 비해 나의 이익이 높아지겠습니다. 일의 성패가 시각에 달렸으니 부르게 도모할수력 이익 또한 크겠습니다. 서쪽으로 가면 재물이 있으니 나가면 얻겠습니다.','목마른 용이 물을 얻었고 배고픈 자가 풍유를 만났습니다. 마음도 몸도 화평하며 바라고 소망하던 꿈들을 모두 이루게되는 좋은 운입니다. 동지 달과 섣달에 생남할 길운이 기다리고 있으니 마음이 부풀게 되겠습니다.','불길한 운이 복덕으로 뒤바뀌니 가정이 기쁨으로 가득하겠습니다. 운이 밝은 빛 내리듯 내게로 쏟아지니 후회할 수도 따르겠습니다. 만일 그러나 십하의 자녀가 생산하지 않을 경우는 복재가 따를 것을 염두에 두어야 할 것합니다.','2025-03-02 03:02:00.920884+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (377,'008','春天的兔子向东升起，因此清晰的灯光就像清晰。西方有一段时间，所以有一个好消息。今年的运气将通过帮助我来完成很多工作。幸福必须有一件好事，这就是为什么上帝保护我的原因。另外，由于一切都像我的心一样，我会更加幸运。今年，南部和北部有很好的祝福，所以我会去那里。但是，关于好事有很多事情可以得到一件好事。 4月，随着大麦在南风，经历和胸部之后，他们将充满腹部。由于一切都是按照我的意志完成的，所以思想和行动是相同的，美德很丰富，因此就像是拥有宝藏的天空一样。','它与月亮聪明校友的李子相同。随着运气跟随身体，运气下降将得到改善，并增加了财富。这个月将像山一样收集财富，所以我们将取得胜利。','月球的声音在高凉亭中会很高。在丰富的美德中，颜色是如此普遍，所以我会吸引富人。好事将发生，您将获得财产，如果您出去，您将获得更大的利润。如果这个月，后代有坡度，那么这就是一个很好的例子。','不要有很长的路要走。很长时间在家离开。明天在您家中安静地干燥，而不是去更大的Deokdeok，这是一个好主意。不要向南走。丑陋的箱子潜伏着。','它有多美丽，因为芽坐在柳树上？每项工作都将是黄金，因此将看到世界的历史。随着花朵的掉落和果实的收获，财富将是丰富的，当然，生活将是和平的。对待亲戚接近亲戚。','当我们收集狂犬病和像山一样长的路时，只有好事就会发生。但是这个月，有许多官员，所以要小心。如果不是这种情况，则将进行结构。我将看不到太多。','不会有太多利润。您可以伤害我，因为亲密的人比其他人还差。不要去水，一个认识的人会生下我。如果您不与他人辞职，那么您一定有圣礼。避免出口并保持自己。','我会跟随运气。利润无处不在，因此无论您走到哪里，都会发生。丹比（Danbi） - 像美德一样落下，所以财富将像一个有钱人一样完成。但是我恐怕我有钱。超越我，所以要小心一切','如果您努力工作而没有休息，那么天空就会给我留下深刻的印象，并使我受益。如果您向东和向西走，那将是很长的。如果您以贪婪垂涎的东西，那将是一场灾难，因此最好让人类的多里（Dori）毫无恐惧。','如果您走上路边，那就是一种灵巧的，所以上班不好。还有一个主人，一个高山里有一个百合花。它应该是一个满足困难的事情的胡安。','无论您做什么，与其他人相比，我的利润都会增加。工作的成功或失败取决于时间，因此利润将大大获利。如果您向西走，有财富，所以如果您出去，就会得到它。','口渴的巨龙得到了水，饥饿的人遇到了pungyu。实现我们希望和希望的所有梦想是一个好运。我会肿胀，因为我正在等待冬至月和元旦。','不祥的运气颠倒了，家庭将充满喜悦。我会倒在我身上，好像我很幸运。我会后悔的。但是，如果未产生十个孩子，则应牢记遵循参考文献。','2025-03-02 03:02:00.920884+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (448,'008','春のウサギは東に上昇するので、明確な光は澄んだようなものです。西に長さがあるので、良いニュースがあります。今年の運は私を助けて多くの仕事をするでしょう。幸せになるには良いことがなければなりません。それが神が私を守る理由です。また、すべてが私の心のようであるので、私はもっと祝福されます。今年、南と北に良い祝福があるので、私はそこに行きます。しかし、良いことについて良いことをするために多くのことがあります。 4月、大麦が南風に湧き出ると、経験と胸の後、彼らは腹部でいっぱいになります。すべてが私の意志に従って行われているので、思考と行動は同じであり、美徳は豊富であるため、空を宝物で見るようなものです。','それは月の明るい卒業生の梅と同じです。運が身体に続くと、運が良くなり、富の追加が拡大されます。今月は山のような富を集めるので、私たちは勝利を収めます。','高パビリオンでは月の音が高くなります。豊かな美徳の真っin中は、色はとても広まっているので、私は金持ちを描きます。良いことが起こり、あなたはあなたの財産を得るでしょう、そしてあなたが外出するとあなたはより大きな利益を得るでしょう。今月の場合、子孫には斜面があるので、それは良い例です。','長い道のりを歩かないでください。家にいて去るのは長いです。グレータードクデオクに行くのではなく、あなたの家で明日を静かに乾燥させることをお勧めします。南に行かないでください。醜い胸が潜んでいます。','芽が柳に座っていたので、どれほど美しいですか？すべての仕事は金になるので、世界の歴史が見られます。花が落ちて果物が獲得されると、富は豊富になり、もちろん人生は平和になります。親relativeをあなたの親relativeの近くに扱ってください。','狂犬病を集めて山のように長い道のりを歩むと、良いことだけが起こります。しかし、今月は多くの役人がいるので、注意してください。そうでない場合、建設が続きます。私はそれをあまり見ることができません。','あまり利益はありません。親しい人は他の人よりも悪いので、あなたは私を傷つけることができます。水に行かないでください、そして知っている人が私を出産するでしょう。他の人と辞めない場合は、秘跡が必要です。あなたの出口を控えて、自分自身を守ってください。','私は運に従います。利益はどこにでもあるので、どこへ行っても起こるでしょう。ダンビのような美徳が落ちるので、富は金持ちのように行われます。しかし、私は金持ちを持っているのではないかと心配しています。私をオーバーハックするので、すべてに注意してください','あなたが休憩なしで熱心に働くなら、空は感銘を受け、私に利益をもたらします。東と西に行くと、長くなります。あなたが貪欲で噴水から物を切望しているなら、それは災害になるので、怖くなく人間のドリを維持する方が良いです。','道路の脇に行くと器用さがあるので、仕事に行くのは良くありません。また、高い山にユリがいる所有者もいます。難しいことを果たすのは、フアン・ゴングでなければなりません。','あなたが何をするにしても、私の利益は他の人と比較して増加します。仕事の成功または失敗は時間に依存するため、利益は非常に収益性が高くなります。西に行くと富がありますので、外出するとそれが得られます。','のどが渇いたドラゴンは水を手に入れ、空腹の人々はPungyuに出会いました。私たちが望み、望むすべての夢を実現することは幸運です。冬至と新年を待っているので、私は腫れます。','不吉な運は逆転し、家族は喜びに満ちています。私はラッキーな光のように私に注ぎます。後悔します。ただし、10人の子供が作成されていない場合は、参照に従うことに留意する必要があります。','2025-03-02 03:02:00.920884+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (306,'008','The spring rabbit rises east, so the clear light is like clear. There is a length in the west, so there is a good news. This year''s luck will do a lot of work by helping me. There must be a good thing to be happy, which is why God protects me. Also, as everything is like my heart, I will be more blessed. This year, there are good blessings in the south and north, so I will go there. However, there are many things to get like a good thing about good things. In April, as the barley springs in the south wind, after the experience and chest, they will be full of abdomen. Since everything is done according to my will, the thoughts and actions are the same, and the virtue is abundant, so it is like seeing the sky with a treasure.','It is the same as the plum for the moon''s bright alumni. As the luck follows the body, the falling luck will be improved and the addition of the riches will be widened. This month will collect riches like a mountain, so we will be triumphant.','The sound of the moon will be high in the high pavilion. In the midst of the rich virtue, the color is so widespread, so I will draw the rich. Good things will happen, and you will get your property and you will get a bigger profit if you go out. If this month, the descendants have a slope, so it is a good example.','Do not take a long way. It is long to be at home and to leave. It''s a good idea to quietly dry tomorrow in your house rather than go to the greater Deokdeok. Do not go south. Ugly chests are lurking.','How beautiful is it because the buds have been sat on the willow? Every work will be gold, so the world''s history will be seen. As the flowers fall and the fruit will be gained, the riches will be abundant and of course the life will be peaceful. Treat your relatives close to your relatives.','As we collect rabies and get a long way like a mountain, only good things will happen. But this month, there is a number of officials, so be careful. If this is not the case, the construction will follow. I will not be able to see it too much.','There will be not much profit. You can harm me because the close person is worse than others. Do not go to water and someone who knows will give birth to me. If you do not quit with others, you must have a sacrament. Refrain from your exit and keep yourself.','I will follow the luck. The profits are everywhere, so it''s going to happen wherever you go. Danbi -like virtues fall, so wealth will be done like a rich man. But I am afraid that I have a rich. Overhak me, so be careful with everything','If you work diligently without a break, the sky will be impressed and will benefit me. If you go east and west, it will be long. If you covet things out of the fountain with greed, it will be a disaster, so it is better to keep the human dori without scary.','If you go on the side of the road, there is a dexterity, so it is not good to go to work. There is also a owner that there is a lily in a high mountain. It should be a Juan -gong that fulfills difficult things.','Whatever you do, my profits will increase compared to others. The success or failure of work depends on the time, so the profit will be greatly profitable. If you go west, there is wealth, so if you go out, you will get it.','Thirsty dragons got water and hungry people met Pungyu. It is a good luck to fulfill all the dreams that we hope and hope. I will be swollen because I am waiting for the winter solstice moon and the New Year''s Day.','The ominous luck is reversed and the family will be filled with joy. I will pour into me as if I''m lucky light. I will regret it. However, if a child of ten is not produced, it should be kept in mind that the reference will be followed.','2025-03-02 03:02:00.920884+00','e');
